import React, { useState } from "react";

import Folder from "./Folder";

function Load({ folder }) {
  const [expand, setExpand] = useState(false);
  return (
    <div>
      {folder.map((fold) => {
        if (!fold.isFolder) {
          <div style={{ marginLeft: "20px" }}>{fold.name}</div>;
        } else {
          <Folder folder={fold.items} />;
        }
      })}
    </div>
  );
}

export default Load;
